import React from 'react';
import { withStyles } from '@material-ui/core/styles';
import storiesStyles from '../styles/storiesStyles';
// Material Component
import Grid from '@material-ui/core/Grid';
// Stories Data
import studentsData from './storiesData';
// Local Component
import HorizontalCard from './HorizontalCard';

const Students = (props) => {
  const { classes } = props
  return(
    <section className={classes.sectionContainer}>
      <h2> STUDENTS ON THE RISE </h2>
      <p>Check out these up and coming entrepreneurs whose businesses are about ready to take off.</p>
      <Grid direction="column" container spacing={16} justify="center" alignItems="center" className={classes.photoBoxsContainer}>
        {studentsData.map(student => (
        <Grid item key={student.id} className={classes.photoBoxContainer}>
          <HorizontalCard {...student}/>
        </Grid>
      ))}
      </Grid>
    </section>
  )
}

export default withStyles(storiesStyles)(Students);
